import { Typography } from "@material-ui/core";
import * as React from "react"
import './main.css';
import responsive from './redesign.png';
import iterative from './iterative.png';
import development from './development3.png';
import hashtags from './hashtags.png';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import { makeStyles } from "@material-ui/core/styles";
import { Link } from "react-router-dom";

const pieces = [
    {
        name: "Responsive Redesign",
        image: responsive,
        link: "/redesign",
        desc: "Redesigning a local business website based on usability principles of user interface design",
    },
    {
        name: "Iterative Design",
        image: iterative,
        link: "/iterative",
    },
    {
        name: "Development",
        image: development,
        link: "/development",
    },
    {
        name: "Hashtag Activism",
        image: hashtags,
        link: "/hashtags",
    },
]

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
  media: {
    height: 140,
  },
});


const Home = () => {
    const classes = useStyles();
    return (
        <div className="main">
            <Typography className="intro-text" variant='h2'>Hi there, my name is Tiffany.</Typography>
            <Typography className="intro-text-sub" variant='h5'><p>I'm a student at Brown University mainly working in AI/Machine Learning and Data Science </p>
            <p>... but currently learning UI/UX design.</p></Typography>
            <div className="pieces">
                {pieces.map(piece => 
    <div className="project">            
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={piece.image}
          title={piece.name}
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
          {piece.name}
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
      <Link to={piece.link} style={{ textDecoration: 'none' }}>
      <Button size="small" color="primary">
          Learn More
        </Button></Link>

      </CardActions>
    </Card>
                     </div>


                )}
            </div>
        </div>
    );
}

export default Home;
